import Nav from "../Nav/Nav";
import { HeaderWrap } from "./Header.styles";

function Header() {
    return(
        <HeaderWrap style={{ height: '300px', backgroundColor: 'black' }}>
            <Nav />
        </HeaderWrap>
    );
}

export default Header;
